INSERT INTO `imbra_question` (`id`,`cat_id`,`title`,`explain_title`,`positive_answer`,`negative_answer`,`only_explain`)
VALUES
	(1,1,'Do you have or did you have in the past, any court order restraining your physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against you?','If yes, explain and/or describe - no names and no addresses please.','re: To the question: Do you have or did you have in the past, any court order restraining your physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against?, {Name} answered YES and provided the following explanation:\r\n<br />\r\n{explanation}','{Name} states that {he} has not had any court orders restraining my physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against him.',0),
	(1,2,'Do you have or did you have in the past, any court order restraining your physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against you? PL','If yes, explain and/or describe - no names and no addresses please.','To the question: Do you have or did you have in the past, any court order restraining your physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against?, {Name} answered YES and provided the following explanation: PL\n<br />\n{explanation}','{Name} states that {he} has not had any court orders restraining my physical contact or communication with or behavior towards another person, including any temporary or permanent civil restraining order or protection order issued against him. PL',0),
	(2,1,'Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity?','If yes, explain and/or describe.','To the question: Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity?, {Name} answered YES and provided the following explanation:\r\n<br />\r\n{explanation}\r\n','{Name} states that {he} has never had any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity.',0),
	(2,2,'Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity?','If yes, explain and/or describe.','To the question: Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity?, {Name} answered YES and provided the following explanation:\n<br />\n{explanation}\n','{Name} states that {he} has never had any Federal, State, or local arrest or conviction for homicide, murder, manslaughter, assault, battery, domestic violence, rape, sexual assault, abusive sexual contact, sexual exploitation, incest, child abuse or neglect, torture, trafficking, peonage, holding hostage, involuntary servitude, slave trade, kidnapping, abduction, unlawful criminal restraint, false imprisonment, stalking, or any similar activity.',0),
	(3,1,'Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for \n<ul>\n<li>solely, principally, or incidentally engaging in prostitution </li>\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or </li>\n<li>any receipt, in whole or in part, of the proceeds of prostitution. </li>\n</ul>','If yes, explain and/or describe.','To the question: Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for\r\n<ul>\r\n<li>solely, principally, or incidentally engaging in prostitution</li>\r\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or</li>\r\n<li>any receipt, in whole or in part, of the proceeds of prostitution,</li>\r\n</ul>\r\n\r\n{Name} answered YES and provided the following explanation:<br />\r\n{explanation}','{Name} stated that {he} has never had any Federal, State, or local arrest or conviction for\r\n<ul>\r\n<li>solely, principally, or incidentally engaging in prostitution</li>\r\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or</li>\r\n<li>any receipt, in whole or in part, of the proceeds of prostitution.</li>\r\n</ul>',0),
	(3,2,'Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for \n<ul>\n<li>solely, principally, or incidentally engaging in prostitution </li>\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or </li>\n<li>any receipt, in whole or in part, of the proceeds of prostitution. </li>\n</ul>','If yes, explain and/or describe.','To the question: Do you have, or did you have in the past, any Federal, State, or local arrest or conviction for\n<ul>\n<li>solely, principally, or incidentally engaging in prostitution</li>\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or</li>\n<li>any receipt, in whole or in part, of the proceeds of prostitution,</li>\n</ul>\n\n{Name} answered YES and provided the following explanation:<br />\n{explanation}','{Name} stated that {he} has never had any Federal, State, or local arrest or conviction for\n<ul>\n<li>solely, principally, or incidentally engaging in prostitution</li>\n<li>any direct or indirect attempt to procure prostitutes or persons for the purpose of prostitution, or</li>\n<li>any receipt, in whole or in part, of the proceeds of prostitution.</li>\n</ul>',0),
	(4,1,'Do you have or did you have in the past, any Federal, State or local arrest or conviction for offenses related to controlled substances or alcohol?','If yes, explain and/or describe.','To the question: Do you have or did you have in the past, any Federal, State or local arrest or conviction for offenses related to controlled substances or alcohol?, {Name} answered YES and provided the following explanation:\r\n{explanation}','{Name} states that {he} has not had any local conviction for offenses related to controlled substances or alcohol. ',0),
