VALUES
	(1,1,'Sex Offense','Your membership has been denied','<p>We are sorry to inform you but based on the information you provided in your IMBRA application and your profile, we cannot accept you as a member on LoveStreet.pl.</p>\r\n<p>To find out more about IMBRA law and the obligations of the dating websites resulting from it, just google the word IMBRA.</p>\r\n<p>To find out more on dating security and obligation of the dating websites to protect their regarding protection and security of its members, just google \'Internet security\'.</p>.\r\n<p>If you decide to write to us, please note that we do not guarantee we will respond. There are hundreds of dating services available on-line and most of them do not take security and verification as seriously as we do, so we are certain that your needs will be accommodated by another service.</p>\r\n<br>\r\nLoveStreet.pl \r\n\r\n',NULL,'system@polishromance.com','noreply@polishromance.com','',NULL),
	(3,1,'Congratulations','Congratulations','Congratulations, you IMBRA has been approved.',NULL,'admin@polishromance.com','no-reply@polishromance.com','',NULL),
	(4,1,'Denial Elaborated','Your membership has been denied','<p>We are sorry to inform you but based on the information you provided in your IMBRA application and your profile, we cannot accept you as a member on LoveStreet.pl.</p>\r\n<p>To find out more about IMBRA law and the obligations of the dating websites resulting from it, just google the word \'IMBRA\'.</p>\r\n<p>To find out more about dating security and the obligation of the dating websites regarding protection and security of their members, just google \'Internet security\'.</p>\r\n<p>If you decide to write to us, please note that we do not guarantee we will respond. There are hundreds of dating services available on-line and most of them do not take security and verification as seriously - we are certain that you will find service that will accommodate your needs</p>\r\nLoveStreet.pl ',NULL,'system@polishromance.com','noreply@polishromance.com','',NULL),
	(7,1,'IMBRA Test Template 1','Your membership has been denied','<p>We are sorry to inform you but based on the information you provided in your IMBRA application and your profile, we cannot accept you as a member on LoveStreet.pl.</p>\r\n<p>To find out more about IMBRA law and the obligations of the dating websites resulting from it, just google the word IMBRA.</p>\r\n<p>To find out more on dating security and obligation of the dating websites to protect their regarding protection and security of its members, just google \'Internet security\'.</p>.\r\n<p>If you decide to write to us, please note that we do not guarantee we will respond. There are hundreds of dating services available on-line and most of them do not take security and verification as seriously as we do, so we are certain that your needs will be accommodated by another service.</p>\r\n<br>\r\nLoveStreet.pl \r\n\r\n','Footer','system@polishromance.com','noreply@polishromance.com','','2009-02-05 21:44:21');
