	(1,2,'Welcome email (Approval OFF)','Welcome email sent when registration is complete',1,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Witamy na Szukam Milionera!','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nTwoje konto jest ju aktywne. Moesz si <a href=\"{LOGIN_URL}\">zalogowa</a> i zacz szuka swojej mioci.\r\n\r\nPowodzenia!\r\n\r\nMonika | <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','-----------------------------------------------------------------------------\r\n<a href=\"http://lovestreet.pl/dashboard/emailNotifications.html\">Wycz wiadomoci</a> | <a href=\"http://lovestreet.pl/dashboard/deactivate.html\">Dezaktywuj konto</a> | <a href=\"http://lovestreet.pl/dashboard/deleteYourAccount.html\">Zamknij konto</a> | Zapomniae haso? <a href=\"http://lovestreet.pl/profile/forgotYourPassword.html\">Odzyskaj je</a>','hello@szukammilionera.pl'),
	(2,1,'Confirm Password Reset (Forgot Password)',NULL,1,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Your PolishDate.com account','This message is not a spam. You registered with <a href=\"http://polishdate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nDear {Username},\r\n\r\nWe have received your request to change password. In order to complete this change, click <a href=\"{CONFIRMATION_URL}\">here</a>.\r\n\r\nIf clicking does not work, copy and paste this link into your browser:\r\n{CONFIRMATION_URL}\r\n\r\nPlease note: The links will expire in 24 hours.\r\n\r\nThank you,\r\n\r\n<a href=\"http://www.PolishDate.com\">PolishDate.com</a>\r\n\r\n<a href=\"{WEB_MAIL_URL}\">web mail</a>','','hello@szukammilionera.pl'),
	(2,2,'Confirm Password Reset (Forgot Password)',NULL,1,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Potwierd zmian na koncie','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nOtrzymalimy danie zmiany hasa. Aby dokoczy operacje, <a href=\"{CONFIRMATION_URL}\">kliknij tutaj</a>.\r\n\r\nJeli to nie dziaa, przekopiuj ponisze cze i wklej do paska adresowego twojej wyszukiwarki, po czym kliknij Enter:\r\n{CONFIRMATION_URL}\r\n\r\nUwaga: cze wyganie po 24 godzinach.\r\n\r\nDzikujemy,\r\n\r\n<a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','','hello@szukammilionera.pl'),
