	(3,2,'Confirm Password Change (onEditRegistration)',NULL,0,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Zmiana na twoim koncie','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nAby dokoczy zmian hasa, <a href=\"{CONFIRMATION_URL}\">kliknij tu</a>.\r\n\r\nJeli cze nie dziaa, przekopiuj i wklej w pole adresowe wyszukiwarki, nastpujcy adres internetowy:\r\n{CONFIRMATION_URL}\r\n\r\ncze wyganie po upywie 24 godzin.\r\n\r\nJeli nie musisz ju zmienia hasa, po prostu zignoruj te wiadomo.\r\n<br />\r\n<a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a>\r\n<br />','','hello@szukammilionera.pl'),
	(4,1,'Change Email - Confirm   ',NULL,0,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','New Email Address Confirmation','Your email address has been entered into PolishDate and we just want to \r\nconfirm that it was actually you who did it. If so, click the following link: <br />\r\n<a href=\"{CONFIRMATION_URL}\">{CONFIRMATION_URL}</a>\r\n\r\nIf clicking the above link doesn\'t work, copy and paste it into your browser\'s location bar.\r\n\r\nIf it wasn\'t you, you don\'t need to do anything.  We will never do anything with \r\nthis email address again.','<br />\r\nKind Regards\r\n\r\n<a href=\"http://www.PolishDate.com\"\">PolishDate.com</a>','hello@szukammilionera.pl'),
	(4,2,'Change Email - Confirm   ',NULL,0,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Potwierd zmian na koncie','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nTwj adres emailowy zosta wprowadzony do SzukamMilionera.com i chcemy potwierdzi, e ty tego dokonae. Jeli tak, kliknij na ponisze cze: <br />\r\n<a href=\"{CONFIRMATION_URL}\">{CONFIRMATION_URL}</a>\r\n\r\nJeli klikanie nie dziaa, skopiuj cze i wklej do paska adresowego twojej wyszukiwarki, po czym kliknij Enter. \r\n\r\nJeli nie ty wprowadzie ten adres emailowy, nie musisz nic robi i zignoruj t wiadomo. Nigdy w aden sposb nie wykorzystamy twojego adresu emailowego.\r\n<br />\r\n<a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','','hello@szukammilionera.pl'),
	(5,1,'Change Email - Undo',NULL,0,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Your email has been changed','This message is not a spam. You registered with <a href=\"http://www.PolishDate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nDear {FullName},\r\n\r\nYour email address on PolishDate.com - {TMP_EMAIL} - has been changed to {EMAIL}.\r\nIf it was you who made the change, you do not have to do anything - just leave this message in your inbox.\r\nIf however it was not you who made the change, please click on the emergency link now to undo the change: \r\n\r\n<a href=\"{UNDO_URL}\">{UNDO_URL}</a> \r\n\r\nor contact us immediately at emergency@PolishDate.com.\r\nIf clicking the above link doesn\'t work, try cutting and pasting it into your browser\'s location bar.\r\n\r\nWhen you log in again into your account, please change your password immediately. \r\n<br />','Thank you & Kind Regards\r\n\r\n<a href=\"http://www.polishdate.com\"\">PolishDate.com</a>','hello@szukammilionera.pl'),
	(5,2,'Change Email - Undo',NULL,0,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Twj adres emailowy na SzukamMilionera (LoveStreet.pl) zosta zmieniony.','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nTwj adres emailowy na LoveStreet.pl - {TMP_EMAIL} - zosta zmieniony na {EMAIL}.\r\nJeli ty dokonae tej zmiany, nic nie musisz robi. Po prostu pozostaw te wiadomo w swojej emailowej. Jeli jednak nie ty dokonae zmiany adresu, kliknij na cz ratunkowe aby te zmian uniewani:  \r\n\r\n<a href=\"{UNDO_URL}\">{UNDO_URL}</a> \r\n\r\nJeli klikanie nie dziaa, skopiuj cze i wklej do paska adresowego wyszukiwarki, po czym kliknij Enter, lub skontaktuj si z nami pod adresem support@lovestreet.pl.\r\n<p>\r\nKiedy ju si zalogujesz, natychmiast zmie swoje haso.  \r\n</p>\r\n<a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','','hello@szukammilionera.pl'),
	(6,1,'Another member closed account | Admin Notification',NULL,0,1,0,NULL,'PolishDate <hello@szukammilionera.pl>','admin@polishdate.com',NULL,'polishromance@gmail.com','Another member closed account | Admin Notification','Username:  {Username}<br />\r\nFirst Name: {FIRST_NAME}<br />\r\nLast Name: {LAST_NAME}<br />\r\nID: {ID} <br />\r\nhas closed his/ her profile due to the following reason:<br />\r\n{REASON}\r\n<br />\r\n{Username}\'s profile can be accessed here:<br />\r\n<a href=\"{PROFILE_URL}\">{PROFILE_URL}</a>\r\n<br />','Your sincerely,\r\nThe System','hello@szukammilionera.pl'),
	(7,1,'Tell-a-friend',NULL,0,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','{EMAIL} is sending you an email from PolishDate.com','This message is not a spam. It was sent from <a href=\"http://www.PolishDate.com\">PolishDate.com</a> by ({EMAIL}) using our Tell-a-Friend feature. We have not captured or recorded your information.\r\n-----------------------------------------------------------------------------\r\nHello,\r\n\r\nYour friend ({EMAIL}) is recommending you our website <a href=\"http://www.PolishDate.com\">http://www.PolishDate.com</a>.\r\nPolishDate.com is a dating service for Polish singles and their admirers.\r\n\r\nIf you think this message was sent to you by error, it is safe to just ignore it. We will never use your account again. \r\n<br />','Kind Regards<br />\r\n<a href=\"http://www.PolishDate.com\"\">PolishDate.com</a>  ','hello@szukammilionera.pl'),
	(7,2,'Tell-a-friend',NULL,0,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','{EMAIL} przesya ci wiadomo','Ta wiadomo nie jest spamem. Wysana zostaa z <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> przez ({EMAIL}) przy uyciu narzdzia zwanego Pole Nas Znajomym. Nie zachowalimy w aden sposb twoich danych.\r\n-----------------------------------------------------------------------------\r\nCze,\r\n\r\nTwj znajomy ({EMAIL}) poleca ci <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>.\r\nSzukamMilionera.com to miejsce spotka zamonych mczyzn i atrakcyjnych kobiet.\r\n\r\nJeli uwaasz, e zaproszenie to zostao ci wysane przez pomyk, po prostu zignoruj je. Ju nigdy wicej nie uyjemy twojego adresu emailowego. \r\n<br />','Z powaaniem\r\n\r\n<a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n','hello@szukammilionera.pl'),
	(8,1,'Registration Reminder (You haven\'t finished your registration...)','Sends when member does not complete registration',0,0,1,'A','PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','You haven\'t finished your registration!','This message is not a spam. You registered with <a href=\"http://www.PolishDate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\nIf you have problems viewing this page, please click <a href=\"{WEB_MAIL_URL}\">here</a>.\r\n-----------------------------------------------------------------------------\r\nHello,\r\n\r\nIt looks like you have not finished your registration with PolishDate.com.\r\nWe encourage you to complete the sign up. Just <a href=\"http://polishdate.com/en/signin.html\" class=\"sec_link\">log in</a> and take the remaining few steps and, who knows, you might be on your way to find a love of your life time!\r\n\r\nKind Regards\r\n\r\n<a href=\"http://www.PolishDate.com\"\">PolishDate.com</a><br />','-----------------------------------------------------------------------------\r\nIf you forgot your password, click <a href=\"http://polishdate.com/en/dashboard/deleteYourAccount.html\">here</a> and follow instructions.','hello@szukammilionera.pl'),
	(8,2,'Registration Reminder (You haven\'t finished your registration...)','Sends when member does not complete registration',0,0,1,'A','SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Nie dokoczye rejestracji!','Ta wiadomo nie jest spamem. Rejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nWyglda na to, e nie dokoczye rejestracji na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>), a przecie kto wie, moe wanie u nas znajdziesz swoj mio? Pom swemu przeznaczeniu i <a href=\"http://lovestreet.pl/signin.html\" class=\"sec_link\">zaloguj si</a> aby dokoczy rejestracj. \r\n<br />\r\nMonika | <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','','hello@szukammilionera.pl'),
	(9,1,'Activity On Profile Report',NULL,0,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','There was activity on your profile','If you have problems viewing this page, please click <a href=\"{WEB_MAIL_URL}\">here</a>.\r\nThis message is not a spam. You registered with <a href=\"http://polishdate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}. \r\n-----------------------------------------------------------------------------\r\nHi {Username}!\r\n\r\nThere was some activity on your profile which you may want to know about:\r\n\r\n<strong>{NB_MESSAGES} new messages</strong>. You have {NB_MESSAGES} unread message(s). See <a href=\"http://polishdate.com/en/messages.html\" class=\"actions\">your new message(s)</a>.\r\n\r\nYou have {NB_WINKS} new wink(s) that you have not viewed yet. See <a href=\"http://polishdate.com/en/winks.html\" class=\"actions\">who winked you</a>.\r\n\r\nYou have been added to the hot-list by {NB_HOTLIST} new user(s), since you last viewed \"who hot-listed me\" page. See <a href=\"http://polishdate.com/en/hotlist.html\" class=\"actions\">who hot-listed you</a>.\r\n\r\nYour profile have been viewed by {NB_PROFILE_VIEWES} new member(s) since your last review. See <a href=\"http://polishdate.com/en/visitors.html\" class=\"actions\">who viewed your profile</a>.\r\n\r\nOr just <a href=\"http://polishdate.com/en/signin.html\" class=\"actions\">log into your account</a> and see all the recent activity.\r\n\r\nGood Luck\r\n\r\n<a href=\"http://www.polishdate.com\" class=\"actions\">PolishDate.com</a>\r\n<br />','-----------------------------------------------------------------------------<br />\r\n<a href=\"http://polishdate.com/en/dashboard/emailNotifications.html\">Unsubscribe</a> | <a href=\"http://polishdate.com/en/dashboard/deactivate.html\">Deactivate Profile</a> | <a href=\"http://polishdate.com/en/dashboard/deleteYourAccount.html\">Close Account</a> | Forgot password? <a href=\"http://polishdate.com/en/profile/forgotYourPassword.html\">Reset it</a>','hello@szukammilionera.pl'),
	(9,2,'Activity On Profile Report',NULL,0,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Twj profil by przedmiotem zainteresowania | Zobacz co si dziao na twoim profilu','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nTwj profil by przedmiotem zainteresowania, pomylelimy wic, e chcia(a)by o tym wiedzie:\r\n\r\nMasz <strong>{NB_MESSAGES} nowe wiadomoci</strong>. Zobacz <a href=\"http://lovestreet.pl/messages.html\" class=\"actions\">kto o tobie pamita</a>!.\r\n\r\nMasz <strong>{NB_WINKS} nowe pozdrowienia</strong>. Zobacz <a href=\"http://loovestreet.pl/winks.html\" class=\"actions\">kto chce z tob nawiza znajomo</a>!\r\n\r\n<strong>{NB_HOTLIST} uytkownik(w)</strong> doda(o) ci do gorcej listy. Zobacz <a href=\"http://lovestreet.pl/hotlist.html\" class=\"actions\">dla kogo jeste \"hot\"</a>.\r\n\r\n<strong>{NB_PROFILE_VIEWES} uytkownik(w)</strong> obejrzao twj profil. Sprawd <a href=\"http://lovestreet.pl/visitors.html\" class=\"actions\">kto jest twoim cichym wielbicielem</a>.\r\n\r\nKliknij <a href=\"http:www.//szukammilionera.com/signin.html\" class=\"actions\">tu</a> aby si zalogowa.\r\n\r\nPowodzenia!\r\n\r\nMonika | <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','-----------------------------------------------------------------------------\r\n<a href=\"http://lovestreet.pl/dashboard/emailNotifications.html\">Wycz wiadomoci</a> | <a href=\"http://lovestreet.pl/dashboard/deactivate.html\">Dezaktywuj konto</a> | <a href=\"http://lovestreet.pl/dashboard/deleteYourAccount.html\">Zamknij konto</a> | Zapomniae haso? <a href=\"http://lovestreet.pl/profile/forgotYourPassword.html\">Odzyskaj je</a>','hello@szukammi