	(10,1,'1104.1 Renewals Notice (disabled?)',NULL,0,0,3,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Renewal Notice','This message is not a spam. You registered with <a href=\"http://www.PolishDate.com\">PolishDate.com</a> from computer {IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------<br>\r\nWe want to remind you that your account will be renewed in 3 days.<br />\r\nYou account will be charged {SUBSCRIPTION_FEE} automatically and you do not need to take any action.<br />\r\n\r\nTo switch auto-renewal off and cancel your membership, log into your account and go to subscription page.<br />\r\n\r\nClick here to log in to your account','<br />\r\n<br />\r\n<br />\r\nKind Regards\r\n<br />\r\n<br />\r\n<a href=\"http://www.PolishDate.com\"\">PolishDate.com</a>','hello@szukammilionera.pl'),
	(10,2,'1104.1 Renewals Notice (disabled?)',NULL,0,0,3,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Auto-Renewal Failed','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://lovestreet.pl\">LoveStreet.pl</a> dnia {CREATED_AT} z komputera {IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!','','hello@szukammilionera.pl'),
	(11,1,'Auto Deactivation Warning (Where Have You Been?)',NULL,0,0,7,'A','PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Where have you been?','This message is not a spam. You registered with <a href=\"http://www.PolishDate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nHello,\r\n\r\nIt looks like you have not visited us for a while. Well, it is never too late for a date. \r\nSo, if you would like to see who visited your profile or sent you a message, just <a href=\"http://polishdate.com/en/signin.html\" class=\"sec_link\">log in</a>.\r\n\r\nIf you dont log in within the next {DEACTIVATION_DAYS} days, your account will be automatically deactivated.\r\n<br />','-----------------------------------------------------------------------------\r\n<a href=\"http://polishdate.com/en/dashboard/emailNotifications.html\">Unsubscribe</a> | <a href=\"http://polishdate.com/en/dashboard/deactivate.html\">Deactivate Profile</a> | <a href=\"http://polishdate.com/en/dashboard/deleteYourAccount.html\">Close Account</a> | Forgot password? <a href=\"http://polishdate.com/en/profile/forgotYourPassword.html\">Reset it</a>','hello@szukammilionera.pl'),
	(11,2,'Auto Deactivation Warning (Where Have You Been?)',NULL,0,0,7,'A','SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Gdzie si podziewasz?','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> (lub na <a href=\"http://www.lovestreet.pl\">LoveStreet.pl</a>) dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nWyglda na to, e troch zaniedbujesz sprawy uczuciowe. Na szczcie, nigdy nie jest za pno aby to naprawi. Jeli chcesz dowiedzie si, kto odwiedza twj profil lub zobaczy nowych uytkownikw, po prostu <a href=\"http://lovestreet.pl/signin.html\" class=\"sec_link\">zaloguj si</a>. Kto wie, moe tym razem znajdziesz swoj mio. \r\n\r\nJeli nie zalogujesz si w cigu najbliszych {DEACTIVATION_DAYS} dni, twoje konto zostanie dezaktywowane. <br />','-----------------------------------------------------------------------------\r\n<a href=\"http://lovestreet.pl/dashboard/emailNotifications.html\">Wycz wiadomoci</a> | <a href=\"http://lovestreet.pl/dashboard/deactivate.html\">Dezaktywuj konto</a> | <a href=\"http://lovestreet.pl/dashboard/deleteYourAccount.html\">Zamknij konto</a> | Zapomniae haso? <a href=\"http://lovestreet.pl/profile/forgotYourPassword.html\">Odzyskaj je</a>','hello@szukammilionera.pl'),
