	(13,1,'First contact message copy | Admin Notification',NULL,0,1,0,NULL,'PolishDate <hello@szukammilionera.pl>','admin@polishdate.com',NULL,'polishromance@gmail.com','First contact message copy | Admin Notification','A message has been sent from:<br />\r\nSender\'s First Name: {FIRST_NAME}<br />\r\nSender\'s Last Name: {LAST_NAME}<br /> \r\nSender\'s Username: {USERNAME}<br /> \r\nSender\'s Profile URL: {PROFILE_URL} <br />\r\n<br />\r\nTo the following recipient: <br />\r\nRecipient\'s First Name: {TO_FIRST_NAME}<br />\r\nRecipient\'s Last Name: {TO_LAST_NAME}<br />\r\nRecipient\'s Username: {TO_USERNAME}<br />\r\nMessage Subject: {SUBJECT}<br />\r\nMessage:<br />\r\n=============<br />\r\n{MESSAGE}\r\n=============<br />\r\nRecipient\'s Profile URL: {TO_PROFILE_URL}\r\n<br />','Your sincerely,\r\nThe System','hello@szukammilionera.pl'),
