	(20,1,'Welcome email - approved (when Approval ON)','Sends when registration is complete and pre-approval is ON',1,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Welcome to PolishDate!','This message is not a spam. You registered with <a href=\"http://www.PolishDate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nHi {Username}, \r\n\r\nWelcome to PolishDate.com!\r\n\r\nYour account has been verified, reviewed and approved, and you may now <a href=\"http://polishdate.com/en/signin.html\">log in</a> to start your quest for love!</p>\r\n\r\nGood luck!\r\n\r\nThe team at <a href=\"http://www.polishdate.com\">PolishDate.com</a><br />','','hello@szukammilionera.pl'),
	(20,2,'Welcome email - approved (when Approval ON)','Sends when registration is complete and pre-approval is ON',1,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Witamy na SzukamMilionera.com!','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nWitam w serwisie Szukam Milionera!\r\nTwoje profil zosta sprawdzony i zaakceptowany. <a href=\"http://lovestreet.pl/signin.html\">Kliknij tu</a> aby si zalogowa</p>\r\n\r\nPowodzenia!\r\n\r\nMonika | <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />\r\n','','hello@szukammilionera.pl'),
	(21,1,'Account Activation & Email Verification','Activation email send on first registration step',1,0,0,NULL,'PolishDate <hello@szukammilionera.pl>',NULL,NULL,'','Email verification and account activation','This message is not a spam. You registered with <a href=\"http://polishdate.com\">PolishDate.com</a> from computer {REGISTRATION_IP} on {CREATED_AT}, using {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nHi {Username}!\r\n\r\nThank you for registering with PolishDate.com. Please <a href=\"{ACTIVATION_URL}\"> click here</a> to verify your email address. If clicking does not work, copy the link:\r\n\r\n{ACTIVATION_URL}\r\n\r\nand paste it into your browser\'s address field. Then click Enter.\r\n\r\nGood luck with your search for love and happiness.\r\n\r\n<a href=\"http://polishdate.com\" target=\"_blank\">PolishDate.com</a>\r\n<br />','-----------------------------------------------------------------------------\r\nIf you think you received this message by error, it is safe to just ignore it.','hello@szukammilionera.pl'),
	(21,2,'Account Activation & Email Verification','Activation email send on first registration step',1,0,0,NULL,'SzukamMilionera <hello@szukammilionera.pl>',NULL,NULL,'','Aktywacja konta z Szukam Milionera','Ta wiadomo nie jest spamem. Zarejestrowae si na <a href=\"http://www.szukammilionera.com\">SzukamMilionera.com</a> dnia {CREATED_AT} z komputera {REGISTRATION_IP}, uywajc adresu {EMAIL}.\r\n-----------------------------------------------------------------------------\r\nCze {Username}!\r\n\r\nDzikuj za doczenie do grona uytkownikw SzukamMilionera.com. <a href=\"{ACTIVATION_URL}\">Kliknij tu</a> aby dokoczy rejestracj. Jeli klikanie nie dziaa, skopiuj ponisze cze i wklej do paska adresowego swojej wyszukiwarki, po czym przycinij Enter:\r\n\r\n{ACTIVATION_URL}\r\n\r\nycz owocnych poszukiwa!\r\n\r\nMonika | <a href=\"http://www.SzukamMilionera.com\">SzukamMilionera.com</a>\r\n<br />','-----------------------------------------------------------------------------\r\nJeli uwaasz, e otrzymae t wiadomo przez pomyk, po prostu j zignoruj.','hello@szukammilionera.pl'),
